			log += "\t" + ch.toUpperCase() + " :\n\t\t"

			const warnings = this.conversionWarnings[ch]
			if( warnings.length === 0 ){
				log += "No changes; success!\n\n"
			} else {
				log += "* " + this.stringWrap(
					this.conversionWarnings[ch].join( "\n"+"* ") + "\n\n",
